import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

function App() {
  const [list, setList] = useState(["Leanna Graham", "Ervin Howell", "Patricia Lebsack","Chelsey Dietrich", "Mr. Dennis"])
  let itemList = list.map((x, index) => {
    return <li key={`${x}-${index}`}>{x}</li>
  })
  let handleChange = e => {
    let value = e.target.value
    console.log(value)
    let filetered = list.filter(x => x.startsWith(value))
    setList(filetered)
  }
  return (
    <div className="App">
      <input name="search" type="search" onChange={e => handleChange(e)} />
      <div>
        <ul>
          {itemList}
        </ul>
      </div>
    </div>
  );
}

export default App;
